.ace-chrome .ace_gutter {
    background: #01313f;
    color: #d0edf7
}
.ace-chrome .ace_print-margin {
    width: 1px;
    background: #33555E
}
.ace-chrome {
    background-color: #002B36;
    color: #93A1A1
}
.ace-chrome .ace_entity.ace_other.ace_attribute-name, .ace-chrome .ace_storage {
    color: #93A1A1
}
.ace-chrome .ace_cursor, .ace-chrome .ace_string.ace_regexp {
    color: #D30102
}
.ace-chrome .ace_marker-layer .ace_active-line, .ace-chrome .ace_marker-layer .ace_selection {
    background: rgba(255, 255, 255, 0.1)
}
.ace-chrome.ace_multiselect .ace_selection.ace_start {
    box-shadow: 0 0 3px 0px #002B36;
}
.ace-chrome .ace_marker-layer .ace_step {
    background: rgb(102, 82, 0)
}
.ace-chrome .ace_marker-layer .ace_bracket {
    margin: -1px 0 0 -1px;
    border: 1px solid rgba(147, 161, 161, 0.50)
}
.ace-chrome .ace_gutter-active-line {
    background-color: #0d3440
}
.ace-chrome .ace_marker-layer .ace_selected-word {
    border: 1px solid #073642
}
.ace-chrome .ace_invisible {
    color: rgba(147, 161, 161, 0.50)
}
.ace-chrome .ace_keyword, .ace-chrome .ace_meta, .ace-chrome .ace_support.ace_class, .ace-chrome .ace_support.ace_type {
    color: #859900
}
.ace-chrome .ace_constant.ace_character, .ace-chrome .ace_constant.ace_other {
    color: #CB4B16
}
.ace-chrome .ace_constant.ace_language {
    color: #B58900
}
.ace-chrome .ace_constant.ace_numeric {
    color: #D33682
}
.ace-chrome .ace_fold {
    background-color: #268BD2;
    border-color: #93A1A1
}
.ace-chrome .ace_entity.ace_name.ace_function, .ace-chrome .ace_entity.ace_name.ace_tag, .ace-chrome .ace_support.ace_function, .ace-chrome .ace_variable, .ace-chrome .ace_variable.ace_language {
